{"PhysicalProperty"=>{"SchemaLocation"=>"http://snaptshot.ellipseinc.net/asp/MITS_Property_v1.5.xsd", "xmlns:xsi"=>"http://www.w3.org/2001/XMLSchema-instance", "Property"=>[{"managementId"=>"234", "Identification"=>{"type"=>"apartment", "rentaltype"=>"standard", "PrimaryID"=>"20550", "MarketingName"=>"Bell Del Ray", "OwnerLegalName"=>nil, "Address"=>{"Address1"=>"625 East Monroe Ave", "City"=>"Alexandria", "State"=>"VA", "Zip"=>"22301", "Country"=>"United States", "PO_Box"=>nil, "MailingAddress"=>nil, "ShippingAddress"=>nil}, "Latitude"=>"38.820485", "Longitude"=>"-77.0505419", "Fax"=>{"Number"=>"(703) 519-1976"}, "Website"=>"www.bellapartmentliving.com/va/alexandria/bell-del-ray/"}, "Information"=>{"StructureType"=>"Standard", "UnitCount"=>nil, "OfficeHour"=>[{"OpenTime"=>"12:00 PM", "CloseTime"=>"5:00 PM", "Day"=>"Su"}, {"OpenTime"=>"9:00 AM", "CloseTime"=>"6:00 PM", "Day"=>"M"}, {"OpenTime"=>"9:00 AM", "CloseTime"=>"7:00 PM", "Day"=>"T"}, {"OpenTime"=>"9:00 AM", "CloseTime"=>"6:00 PM", "Day"=>"W"}, {"OpenTime"=>"9:00 AM", "CloseTime"=>"7:00 PM", "Day"=>"Th"}, {"OpenTime"=>"9:00 AM", "CloseTime"=>"6:00 PM", "Day"=>"F"}, {"OpenTime"=>"10:00 AM", "CloseTime"=>"5:00 PM", "Day"=>"SA"}], "LongDescription"=>"Bell Del Ray is a brand new apartment community located in the Del Ray neighborhood of Alexandria, Virginia, that's convenient to Potomac Yard, Old Town, and downtown DC. We're a quick walk to the Braddock Road metro stop. Alexandria's Del Ray neighborhood is a truly unique, vibrant place to call home. Known for its independent retail shops, holistic health stores, street festivals and chef-driven restaurant scene, Del Ray has a character all on its own. And with   The Birchmere   legendary music venue just around the corner, you'll never have a dull moment, nor a dull meal, living at Bell Del Ray! \n\n Take an afternoon walk down Mount Vernon Avenue and you'll be introduced to fine wine bars, cheese boutiques, custard shops, cafes and Pizzerias. You'll find locally owned small businesses, hardware stores, yoga studios and shopping options.There's a healthy art community in the area as well, as evidenced by the many eclectic shops and regular events such as Art on the Avenue. And, on the 3 rd  Thursday of each month a new Frist Thursday festival event takes place, drawing locals and out-of-towners to enjoy the many restaurants and local talent offered by the community. \n\n Within close proximity to the George Washington Parkway and the Beltway, an Alexandria apartment places you within driving distance of government facilities and employers in Washington DC and Northern Virginia. You'll find that Maryland is just across the Potomac River and just a stone's throw away too. The easy commute is one of the things that neighborhood residents rave about. If you're from the Washington metro area, then you know how congested the area can become. Call Bell Del Ray home and you'll be only 10 minutes from Washington DC. Now  that's  convenience. Public transportation is a cut above the systems in other major US cities. The Washington DC Metro system extends out into Alexandria and specifically the Del Ray neighborhood, making it an easy commute to so many area employers. If you're in search of a pet friendly apartment near the Braddock Metro, consider your search complete. \n\n Bell Del Ray offers luxury one and two bedroom apartment homes, each with a washer and dryer, spacious walk-in closets, stainless-steel appliances, and more. Residents enjoy our swimming pool, 24hr fitness center, private parking deck, spacious courtyard with lounge areas and so much more. Call to schedule a visit or stop by for a tour today!", "LeaseLength"=>nil, "DrivingDirections"=>"Metro: \n\n Braddock Road Station   (Blue  Yellow Lines)  : .9 Miles - 20 Minute Estimated Walk Time \n\nWalking Directions: Head South on N. West St towards Wythe St. Turn right onto E Braddock Rd then turn right on E Glendale Ave. Walk approximately .4 miles and turn right onto Leslie Ave. After .2 Miles turn right on E Monroe Ave. Destination is on the right."}, "Promotional"=>"Don't Miss Out!!!  \n\n  Limit Time Offer! \n\n  ONE BEDROOM STARTING AT $1699 \n\n    ALL MOVE IN FEES WAIVED   \n\n    DON'T MISS OUT!!", "OnSiteContact"=>{"type"=>"Property manager", "FirstName"=>nil, "LastName"=>nil, "Title"=>nil, "Email"=>"BellDelRay@newhome1.com", "Phone"=>{"Number"=>"(877) 375-5204", "Description"=>"Phone"}}, "Policy"=>{"Pet"=>[{"type"=>"Dog", "allowed"=>"True", "Comment"=>nil, "MaxCount"=>"2", "Deposit"=>"0", "Fee"=>"500", "Rent"=>"50", "Weight"=>"75", "FeeRange"=>nil, "Restrictions"=>nil, "PetCare"=>"False"}, {"type"=>"Cat", "allowed"=>"True", "Comment"=>nil, "MaxCount"=>"2", "Deposit"=>"0", "Fee"=>"500", "Rent"=>"50", "Weight"=>"0", "FeeRange"=>nil, "Restrictions"=>nil, "PetCare"=>"False"}]}, "Floorplan"=>[{"id"=>"50804", "Name"=>"S1", "Comment"=>nil, "UnitCount"=>nil, "Room"=>[{"type"=>"bedroom", "Count"=>"1", "Comment"=>nil}, {"type"=>"bathroom", "Count"=>"1", "Comment"=>nil}], "SquareFeet"=>{"min"=>"517", "max"=>"517"}, "MarketRent"=>{"min"=>"1727", "max"=>"1727"}, "EffectiveRent"=>{"min"=>"1727", "max"=>"1727"}, "Deposit"=>{"type"=>"Security Deposit", "Amount"=>"100", "Description"=>nil, "PercentRefundable"=>nil, "PortionRefundable"=>nil}, "Amenities"=>{"General"=>"http://www.bellapartmentliving.com/va/alexandria/bell-del-ray//availability.asp?FPID=50804"}}, {"id"=>"50805", "Name"=>"A1G2", "Comment"=>nil, "UnitCount"=>nil, "Room"=>[{"type"=>"bedroom", "Count"=>"1", "Comment"=>nil}, {"type"=>"bathroom", "Count"=>"1", "Comment"=>nil}], "SquareFeet"=>{"min"=>"699", "max"=>"699"}, "MarketRent"=>{"min"=>"1813", "max"=>"1813"}, "EffectiveRent"=>{"min"=>"1813", "max"=>"1813"}, "Deposit"=>{"type"=>"Security Deposit", "Amount"=>"100", "Description"=>nil, "PercentRefundable"=>nil, "PortionRefundable"=>nil}, "Amenities"=>{"General"=>"http://www.bellapartmentliving.com/va/alexandria/bell-del-ray//availability.asp?FPID=50805"}}, {"id"=>"50806", "Na